import React from 'react';
import ReactDOM from 'react-dom';
import { Provider } from 'react-redux';
import store from './store/store';

import './styles/index.css';

import App from './App';

ReactDOM.render(
  <Provider store={store}>
    <App />,
</Provider>,
  document.getElementById('root')
);
